PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "budgets" ("id" integer primary key autoincrement not null, "title" varchar not null, "slug" varchar not null, "balance" float not null default '0', "currency" varchar not null default 'RUB', "created_at" datetime, "updated_at" datetime, "deleted_at" datetime);
CREATE TABLE IF NOT EXISTS "budget_user" ("id" integer primary key autoincrement not null, "user_id" integer not null, "budget_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade, foreign key("budget_id") references "budgets"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "incomes" ("id" integer primary key autoincrement not null, "account_id" integer not null, "user_id" integer not null, "title" varchar not null, "source" varchar not null, "amount" varchar not null, "currency" varchar not null, "created_at" datetime, "updated_at" datetime, "deleted_at" datetime, "normalized_title" varchar not null default '', "slug" varchar, foreign key("account_id") references "accounts"("id") on delete cascade, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "accounts" ("id" integer primary key autoincrement not null, "title" varchar not null, "slug" varchar not null, "amount" float not null, "currency" varchar not null, "type" varchar not null, "created_at" datetime, "updated_at" datetime, "deleted_at" datetime, "normalized_title" varchar not null default '');
CREATE TABLE IF NOT EXISTS "account_budget" ("id" integer primary key autoincrement not null, "account_id" integer not null, "budget_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("account_id") references "accounts"("id") on delete cascade, foreign key("budget_id") references "budgets"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "expenses" ("id" integer primary key autoincrement not null, "account_id" integer not null, "user_id" integer not null, "normalized_title" varchar not null default '', "title" varchar not null, "amount" float not null, "currency" varchar not null, "has_items" tinyint(1) not null default '0', "created_at" datetime, "updated_at" datetime, "deleted_at" datetime, "slug" varchar, "amount_calculated" float not null default '0', foreign key("account_id") references "accounts"("id") on delete cascade, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "categories" ("id" integer primary key autoincrement not null, "title" varchar not null, "normalized_title" varchar not null default '', "parent_id" integer not null default '0', "usage_count" integer not null default '0', "created_at" datetime, "updated_at" datetime, "deleted_at" datetime);
CREATE TABLE IF NOT EXISTS "category_expense" ("id" integer primary key autoincrement not null, "category_id" integer not null, "expense_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("category_id") references "categories"("id") on delete cascade, foreign key("expense_id") references "expenses"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "settings" ("id" integer primary key autoincrement not null, "user_id" integer not null, "default_currency" varchar not null default 'RUB', "created_at" datetime, "updated_at" datetime, "deleted_at" datetime, "active_budget" varchar, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "currency_rates" ("id" integer primary key autoincrement not null, "code_from" varchar not null, "code_to" varchar not null, "rate" float not null, "created_at" datetime, "updated_at" datetime, "deleted_at" datetime);
CREATE TABLE IF NOT EXISTS "purchase_items" ("id" integer primary key autoincrement not null, "expense_id" integer not null, "title" varchar not null, "normalized_title" varchar not null, "price" float not null, "quantity" float not null, "created_at" datetime, "updated_at" datetime, "deleted_at" datetime, foreign key("expense_id") references "expenses"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "exchanges" ("id" integer primary key autoincrement not null, "amount_from" float not null, "account_from" integer not null, "currency_from" varchar not null, "amount_to" float not null, "account_to" integer not null, "currency_to" varchar not null, "exchange_rate" float not null, "oficial_rate" float not null default '0', "user_id" integer not null, "slug" varchar, "expense_id" integer, "income_id" integer, "created_at" datetime, "updated_at" datetime, "deleted_at" datetime, foreign key("account_from") references "accounts"("id"), foreign key("account_to") references "accounts"("id"));
CREATE TABLE IF NOT EXISTS "payments" ("id" integer primary key autoincrement not null, "title" varchar not null, "normalized_title" varchar not null, "slug" varchar, "regular" tinyint(1) not null, "frequency" varchar, "amount" float not null, "currency" varchar not null, "created_at" datetime, "updated_at" datetime, "deleted_at" datetime, "total" numeric not null default '0', "total_paid" numeric not null default '0', "total_due" numeric not null default '0', "date" date not null, "credit_percent" numeric not null default '0', "deadline" date, "user_id" integer not null, "budget_id" integer not null, foreign key("user_id") references "users"("id") on delete cascade, foreign key("budget_id") references "budgets"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "operations" ("id" integer primary key autoincrement not null, "account_id" integer not null, "amount" numeric not null, "operation_type" varchar check ("operation_type" in ('income', 'expense')) not null, "operation_id" integer, "description" varchar, "balance_after" numeric not null, "performed_at" datetime not null, "created_at" datetime, "updated_at" datetime, "deleted_at" datetime, foreign key("account_id") references "accounts"("id") on delete cascade);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE INDEX "jobs_queue_index" on "jobs" ("queue");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE UNIQUE INDEX "budgets_slug_unique" on "budgets" ("slug");
CREATE UNIQUE INDEX "accounts_slug_unique" on "accounts" ("slug");
CREATE INDEX "expenses_normalized_title_index" on "expenses" ("normalized_title");
CREATE INDEX "categories_normalized_title_index" on "categories" ("normalized_title");
CREATE INDEX "incomes_normalized_title_index" on "incomes" ("normalized_title");
CREATE UNIQUE INDEX "incomes_slug_unique" on "incomes" ("slug");
CREATE UNIQUE INDEX "expenses_slug_unique" on "expenses" ("slug");
CREATE INDEX "accounts_normalized_title_index" on "accounts" ("normalized_title");
CREATE UNIQUE INDEX "exchanges_slug_unique" on "exchanges" ("slug");
CREATE INDEX "payments_user_id_budget_id_index" on "payments" ("user_id", "budget_id");
CREATE UNIQUE INDEX "payments_slug_unique" on "payments" ("slug");
COMMIT;
